// SPDX-License-Identifier: LGPL-3.0-only
pragma solidity 0.8.4;

import "../interface/IBridge.sol";
import "../interface/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract ERC20Handler is Ownable {
    // resourceID
    bytes32 public rID;

    // bridge合约地址
    address public bridgeAddress;

    // 跨链的代币合约地址
    address public tokenAddress;

    // 目标链上ERC20 handler地址
    address public targetHandler;

    // 跨链的代币是否需要burn
    bool public burnable;

    // Initializes Manager
    constructor(
        bytes32 _resourceID,
        address _bridgeAddress,
        address _tokenAddress,
        address _targetHandler,
        bool _burnable
    ) {
        rID = _resourceID;
        bridgeAddress = _bridgeAddress;
        tokenAddress = _tokenAddress;
        targetHandler = _targetHandler;
        burnable = _burnable;
    }

    // 设置
    function adminSetConfig(
        address _bridgeAddress,
        address _tokenAddress,
        address _targetHandler,
        bool _burnable
    ) public onlyOwner {
        bridgeAddress = _bridgeAddress;
        tokenAddress = _tokenAddress;
        targetHandler = _targetHandler;
        burnable = _burnable;
    }

    // 跨链
    function deposit(
        bytes32 resourceID,
        uint32 targetChainId,
        uint256 amount
    ) public returns (bytes32) {
        require(resourceID == rID, "resourceID error");

        IERC20 erc20 = IERC20(tokenAddress);
        require(erc20.balanceOf(msg.sender) >= amount, "Insufficient funds");

        if (burnable) {
            // burn
            IERC20Burnable erc20Burn = IERC20Burnable(tokenAddress);
            erc20Burn.burnFrom(msg.sender, amount);
        } else {
            // lock
            erc20.transferFrom(msg.sender, address(this), amount);
        }

        bytes memory data = abi.encode(msg.sender, amount);
        // Call bridge
        IBridge bridge = IBridge(bridgeAddress);
        bytes32 messageId = bridge.callRemote(
            resourceID,
            targetChainId,
            targetHandler,
            data
        );

        return messageId;
    }

    // 目标链执行
    function execute(bytes32 resourceID, bytes calldata data) public {
        require(resourceID == rID, "resourceID error");

        uint256 amount;
        address sender;
        (sender, amount) = abi.decode(data, (address, uint256));
        if (burnable) {
            // mint
            IERC20Mintable erc20mint = IERC20Mintable(tokenAddress);
            erc20mint.mint(sender, amount);
        } else {
            // release
            IERC20 erc20 = IERC20(tokenAddress);
            erc20.transfer(sender, amount);
        }
    }
}

contracts/interface/IBridge.sol.content:
// SPDX-License-Identifier: LGPL-3.0-only
pragma solidity ^0.8.4;

/**
    @title Interface for Bridge contract.
 */
interface IBridge {
    struct CallRemoteParam {
        bytes32 resourceID;
        uint32 targetChainId;
        //        uint256 amount; //跨链转账金额
        //        bytes dataNFT; // NFT data
        address target; //目标链合约
        bytes data; //跨链合约调用 data
    }

    function callRemote(
        bytes32 resourceID,
        uint32 targetChainId,
        address target,
        bytes calldata data
    ) external payable returns (bytes32);

    event CallRequest(
        bytes32 resourceID,
        address caller,
        uint32 sourceChainId,
        uint256 sourceNonce,
        bytes32 indexed messageId,
        uint32 indexed targetChainId,
        address indexed target,
        bytes data
    );

    event ConfirmedRequest(
        bytes32 resourceID,
        address caller,
        uint32 sourceChainId,
        uint256 sourceNonce,
        bytes32 indexed messageId,
        uint32 indexed targetChainId,
        address indexed target,
        bytes data
    );

    function execute(
        bytes32 resourceID,
        uint32 sourceChainId,
        uint256 sourceNonce,
        bytes32 messageId,
        uint32 targetChainId,
        address target,
        bytes calldata data,
        bytes[] calldata signatures
    ) external;
}

