// SPDX-License-Identifier: LGPL-3.0-only
pragma solidity 0.8.4;

import "../interface/IBridge.sol";
import "../interface/IERC1155.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

//import "../interface/IBridge.sol";
//import "@openzeppelin/contracts/access/Ownable.sol";
//import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
//import "@openzeppelin/contracts/token/ERC1155/utils/ERC1155Receiver.sol"; // handler需要具备接受ERC1155功能
//import "@openzeppelin/contracts/token/ERC1155/extensions/ERC1155Burnable.sol";
//import "@openzeppelin/contracts/token/ERC1155/presets/ERC1155PresetMinterPauser.sol";

contract ERC1155Handler is Ownable {
    bytes private constant EMPTY_BYTES = "";
    // resourceID
    bytes32 public rID;

    // bridge合约地址
    address public bridgeAddress;

    // 跨链的代币合约地址
    address public tokenAddress;

    // 目标链上ERC20 handler地址
    address public targetHandler;

    // 跨链的代币是否需要burn
    bool public burnable;

    // Initializes Manager
    constructor(
        bytes32 _resourceID,
        address _bridgeAddress,
        address _tokenAddress,
        address _targetHandler,
        bool _burnable
    ) {
        rID = _resourceID;
        bridgeAddress = _bridgeAddress;
        tokenAddress = _tokenAddress;
        targetHandler = _targetHandler;
        burnable = _burnable;
    }

    // 设置
    function adminSetConfig(
        address _bridgeAddress,
        address _tokenAddress,
        address _targetHandler,
        bool _burnable
    ) public onlyOwner {
        bridgeAddress = _bridgeAddress;
        tokenAddress = _tokenAddress;
        targetHandler = _targetHandler;
        burnable = _burnable;
    }

    function deposit(
        bytes32 resourceID,
        uint32 targetChainId,
        uint256[] calldata tokenIDs,
        uint256[] calldata amounts
    ) public returns (bytes32) {
        require(resourceID == rID, "resourceID error");

        bytes memory metaData;

        if (burnable) {
            IERC1155Burnable erc1155Burn = IERC1155Burnable(tokenAddress);
            erc1155Burn.burnBatch(msg.sender, tokenIDs, amounts);
        } else {
            IERC1155 erc1155 = IERC1155(tokenAddress);
            metaData = bytes(erc1155.uri(0));
            erc1155.safeBatchTransferFrom(
                msg.sender,
                address(this),
                tokenIDs,
                amounts,
                EMPTY_BYTES
            );
        }

        bytes memory data = abi.encode(msg.sender, tokenIDs, amounts, metaData);

        // Call bridge
        IBridge bridge = IBridge(bridgeAddress);
        bytes32 messageId = bridge.callRemote(
            resourceID,
            targetChainId,
            targetHandler,
            data
        );

        return messageId;
    }

    function execute(bytes32 resourceID, bytes calldata data) public {
        require(resourceID == rID, "resourceID error");
        address sender;
        uint256[] memory tokenIDs;
        uint256[] memory amounts;
        bytes memory metaData;
        (sender, tokenIDs, amounts, metaData) = abi.decode(
            data,
            (address, uint256[], uint256[], bytes)
        );
        if (burnable) {
            // mint
            IERC1155PresetMinterPauser erc1155Preset = IERC1155PresetMinterPauser(
                    tokenAddress
                );
            // erc1155Preset.mintBatch(sender, tokenIDs, amounts, EMPTY_BYTES);
            erc1155Preset.mintBatch(sender, tokenIDs, amounts, metaData);
        } else {
            // release
            IERC1155 erc1155 = IERC1155(tokenAddress);
            erc1155.safeBatchTransferFrom(
                address(this),
                sender,
                tokenIDs,
                amounts,
                EMPTY_BYTES
            );
        }
    }

    // 没有此方法会报错：ERC1155: transfer to non ERC1155Receiver implementer
    function onERC1155BatchReceived(
        address,
        address,
        uint256[] memory,
        uint256[] memory,
        bytes memory
    ) public virtual returns (bytes4) {
        return this.onERC1155BatchReceived.selector;
    }

    // 用于测试
    function BalanceOfThisHandler(uint256 tokenID) external returns (uint256) {
        IERC1155 erc1155 = IERC1155(tokenAddress);
        return erc1155.balanceOf(address(this), tokenID);
    }
}

